  $peta = $this->db->query("SELECT * FROM kavling_peta")->result();

  foreach ($peta as $pt) {
    if($pt->status == '0'){
      $warna = '#5fff4a';
    }elseif($pt->status == '1'){
      $warna = '#FFF693';
    }elseif($pt->status == '2'){
      $warna = '#ff1100';
    }elseif($pt->status == '3'){
      $warna = '#ff1100';
    }

    if($pt->jenis_map == 'polygon'){
        
         if($pt->status =='0'){
            echo '<a href="'.base_url('transaksi/daridenah/'.$pt->id_kavling.'/'.$pt->status).'">';
          }elseif($pt->status =='1'){
            echo '<a href="#bawah" onclick="add('.$pt->id_kavling.')">';
          }elseif($pt->status =='2'){
            echo '<a href="#bawah" onclick="add('.$pt->id_kavling.')">';
          }elseif($pt->status =='3'){
            echo '<a href="'.base_url('transaksi/daridenah/'.$pt->id_kavling.'/'.$pt->status).'">';
          }
          
        echo '
        <g id="_2197280887856">
            <polygon class="fil10"  points="'.$pt->map.'" style="fill:'.$warna.'"/>
            <g transform="'.$pt->matrik.'">
            <text x="14850" y="10500"  class="fil11 fnt5">'.$pt->kode_kavling.'</text>
        </g>
        </g>
      </a>';
    }

  } 
  
  
  //Hitung statistik
