  $stt_3 = $this->db->query("SELECT * FROM kavling_peta WHERE status='3'")->num_rows();
  $stt_0 = $this->db->query("SELECT * FROM kavling_peta")->num_rows();

  $kosong = $stt_0 - ($stt_1 + $stt_2 + $stt_3);
