<script type="text/javascript">
    $(document).ready(function() {
      $('#form_baru').hide();
      $('#trxbaru').hide();
      $('#kredit').hide();
      $('#kosong').hide();
    });


  function trxbaru()
   {
    // alert("Baru");
    $('#kosong').hide();
    $('#form_baru').show();
   }
   function add(id)
   {
       save_method = 'add';
      //  $('#form')[0].reset(); // reset form on modals
       $('.form-group').removeClass('has-error'); // clear error class
       $('.help-block').empty(); // clear error string
       $('#form').modal('show'); // show bootstrap modal
       $('.modal-title').text('Detail Kavling' + id); // Set Title to Bootstrap modal title
       $('#photo-preview').hide(); // hide photo preview modal

       //Ajax Load data from ajax
       $.ajax({
           url : "<?php echo site_url('dashboard/ajax_edit/')?>" + id,
           type: "GET",
           dataType: "JSON",
           success: function(data)
           {
               $('[name="kode"]').val(data.kode_kavling);
               $('[name="nama_lengkap"]').val(data.nama_lengkap);

               
               $('[id="lokasi"]').text(data.kode_kavling);
               $('[id="panjang"]').text(data.panjang_kanan);
               $('[id="lebar"]').text(data.lebar_depan);
               $('[id="luas"]').text(data.luas_tanah);
               $('[id="harga"]').text(data.harga_jual);
              //  $('[id="status_kav"]').text('Kosong');
               

               if(data.status == '0'){
                  $('[id="status_kav"]').text('Kosong');
                  // $('#trxbaru').hide();
                  // $('#kosong').show();
               }else if(data.status == '1'){
                  $('[id="status_kav"]').text('Booking');
                  // $('#kosong').hide();
               }else if(data.status == '2'){
                  $('[id="status_kav"]').text('Terjual Cash');
                  // $('#kosong').hide();
               }else if(data.status == '3'){
                  $('[id="status_kav"]').text('Terjual Kredit');
                  // $('#kosong').hide();
               }
              
               $('#modal_form').modal('show'); // show bootstrap modal when complete loaded
               $('.modal-title').text('Detail Kavling : ' + data.kode_kavling); // Set title to Bootstrap modal title
              
              $('#photo-preview').show(); // show photo preview modal
              if(data.foto)
              {
                  $('#label-photo').text('Change Photo'); // label photo upload
                  $('#photo-preview div').html('<img src="'+url+'assets/images/'+data.foto+'" class="img-responsive" width="50">'); // show photo
                  $('#photo-preview div').append('<label><input type="checkbox" name="remove_photo" value="'+data.foto+'"/> Hapus foto ketika di simpan</label>'); // remove photo
   
              }
              else
              {
                  $('#label-photo').text('Upload Photo'); // label photo upload
                  $('#photo-preview div').text('(No photo)');
              }
           },
           error: function (jqXHR, textStatus, errorThrown)
           {
               alert('Error get data from ajax');
           }
       });
   }


</script>


